&lt;div style=&quot;text-align: justify;&quot;&gt;Celem artykułu jest przedstawienie wyników badań własnych dotyczących fenomenu biograficznego uczenia się roli nauczycielki wychowania przedszkolnego na podstawie koncepcji Elżbiety Dubas. Badania zrealizowano w strategii jakościowej, w optyce paradygmatu interpretatywnego. Ich celem było poznanie i opisanie znaczenia biograficznego uczenia się do konstruowania i realizowania roli nauczycielki wychowania przedszkolnego.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;Przedmiotem badań uczyniono zatem uczenie się roli nauczycielki wychowania przedszkolnego z biografii własnej i Innych, natomiast problemem badawczym pytanie: Jakie znaczenie ma biograficzne uczenie się do konstruowania i realizowania roli nauczycielki wychowania przedszkolnego przez badane kobiety? W badaniach wykorzystano metodę studium przypadku, a techniką, jaką posłużono się w celu zebrania materiału badawczego, był wywiad narracyjny przeprowadzony z trzema nauczycielkami wychowania przedszkolnego.&lt;/div&gt;
&lt;div style=&quot;text-align: justify;&quot;&gt;Wyniki badań własnych ukazują indywidualny proces biograficznego uczenia się roli nauczycielki wychowania przedszkolnego, jaki wyłania się z narracji badanych kobiet. W podjętych badaniach własnych ustalono, że biografia własna, jak i biografie Innych stanowią istotny walor edukacyjny, a podejmowany nad nimi namysł pozwala na kształtowanie wielu cech i umiejętności, które narratorki wykorzystują, konstruując i realizując własną rolę nauczycieli wychowania przedszkolnego.&lt;/div&gt;
